import axios from "axios"
import { useEffect, useState } from "react";

export default function List(){

  const [users , setUsers] = useState({});

useEffect(() => {
  getuser();
} , [])
   function getuser(){
     axios.get('http://localhost/React_CRUD/api/').then(function(response){
       console.log(response.data);
       setUsers(response.data);
      });
    }
  return(
    <div>
        <h1>List</h1>
        <table>
          <thead>
            <tr>
                <th>#</th>
                <th>Name</th>
                <th>Email</th>
                <th>Password</th>
                <th>Action</th>
            </tr>
          </thead>
          <tbody>
                <tr>
                  {users.map((user,key) => 
                    <tr key={key}>
                        <td></td>
                        <td>{user.name}</td>
                        <td>{user.email}</td>
                        <td>{user.password}</td>
                        <td></td>
                    </tr>
                  )}
                </tr>
          </tbody>
        </table>
    </div>
  )
}
